import React, { Component, Fragment } from 'react';
import {Paper, Grid} from '@material-ui/core';


import './Parking.scss';

 class Parking extends Component {


    render(props) {

        //console.log(this.props.params.id);



        return (
            <Fragment>
                <Grid item sm={4} >
                <div className="parking" onClick={this.props.clicked}>

                    <div className="parking__wrapper">
                        <Paper>
                            <div className="">
                                {/* <Link to={'/parking-details/' +this.props.id} style={{ textDecoration: 'none' }}> */}
                                <Grid container spacing={3}>
                                    <Grid item xs={12} sm={12}>Parking Space <b>{this.props.title}</b></Grid>

                                </Grid>
                                <Grid container spacing={3}>
                                    <Grid item xs={12} sm={6}>Type</Grid>
                                    <Grid item xs={12} sm={6}><b>{this.props.address}</b></Grid>
                                </Grid>
                                <Grid container spacing={3}>
                                    <Grid item xs={12} sm={6}>Tarrif</Grid>
                                    <Grid item xs={12} sm={6}><b>{this.props.created}</b></Grid>
                                </Grid>
                                <Grid container spacing={3}>
                                    <Grid item xs={12} sm={6}>Address</Grid>
                                    <Grid item xs={12} sm={6}><b>{this.props.verified}</b></Grid>
                                </Grid>

                            </div>
                        </Paper>

                    </div>
                </div>
                </Grid>

            </Fragment>

        )
    }
}
export default Parking;
